import React from 'react';
import logo from '../src/image/logo.png';

const Header =()=>{

    return(
        <header>
        <secton>
        <img className="logo" src={logo} alt="logo" />
        <h1>E Test</h1>
        </secton>
        <secton>
        <nav>
        <ul>
        <li>Home</li>
        <li>About us</li>
        <li>Sighn Up</li>
        <li>Login</li>
        </ul>
        </nav>
        </secton>
        </header>

    )
}

export default Header;
